Today and everyday my prayers are with the family of George Floyd and all victims of police brutality and racism. I wanted to wait until after the memorial to speak on this.

I am addressing this issue as a stance again companies who play a role in the systems that fail our black and brown brothers and sisters daily. This is only one example of a very large and in charge problem. Racism and prejudice is prevalent in many areas of our world. We have been made to believe we have to play along to the rules of their game in order to survive, in order to maintain our livelihood. But this is one of the countless lies they have manipulated us into believing. We all deserve better than what we have been given and it is only up to us to refuse anything less than the respect, recognition and retribution we are owed. I stand for every one of my black and brown brothers and sisters who have been denied their right to prosperity. I am proud to be apart of this fight. *this is a response to a head at Ref HQ dming me to have a conversation on my experience - see last slide

